import React from 'react';
import s from '../Content.module.css';

const Post = () => {
    return <div className = {s.posts}>
        <div>
            <a href="#">
                <img src="http://sdo.maxus.ru/xhttp_res?doc_url=x-local://wt_data/objects/54EC45427A3F75/39.xml&elem_path=document.text_area&res_id=08482.png" />
            </a>
        </div>
    </div>
}

export default Post;
